Aisa dinner ho toh bat hi ban jayeüòç

Recipe:

Boil soya chunks as per quantity
Add salt while boiling.
After the soya chunks are boiled  take away all the moisture from it.
No water should be there in the soya chunks.
After that give it a grind in the mixer.
Make a coarse mixture.

Now take a pan.
Add 4 tspn of oil and 2tspn of butter.
Add 2 medium sized finely chopped onions.
Cook until the colour changes to pink.
Now add 1 green chilli finely chopped and ginger garlic paste to it.
Once the raw smell goes away add 3 finely chopped tomatoes.
And cook until the oil seperates.
Now add salt, red chilli powder, Everest Mutton Masala, Everest Kitchen King Masala, Maggi Masala, turmeric, coriander powder and garam masala.
Cook it well.
Now add the soya chunks coarse mixture.
Add little water.
Cook it properly for 10 minutes on low flame till the oil seperates.
Garnish it with coriander leaves.

Serve it with pav.
